('VINAGRE250','VINAGRE DE MANZANA X 250 ML ','Vinagre de manzana natural, elaborado a partir de la doble fermentación del jugo de manzana. Vinagre tradicional utilizado en todo el mundo por su gran versatilidad. Compañero favorito de los chef mas exigentes y amantes de la buena cocina. Se puede consumir directamente diluyendo 3 cucharadas en un vaso con agua, después de las comidas, varias veces al día.','',25000,'Und',5,'NUEVO',(select id from grupos where nombre='VINAGRES NATURALES'),(select id from subgrupos where nombre='OTROS' and idsubgrupo=(select id from grupos where nombre='VINAGRES NATURALES')),(select id from marcas where nombre='VINAGRES GOLDEN '),1,24000,3,null,null,null,null,'VINAGRE250.png'),
('7706160000012','VINAGRE DE MANZANA X 500 ML ','Vinagre de manzana GOLDEN, elaborado a partir del jugo fermentado de manzana (También llamado sidra de manzana) con las formulas ancestrales de nuestros abuelos. Conserva los nutrientes de la fruta, ha sido utilizado por sus propiedades benéficas a la salud humana y es un excelente aderezo. Su sabor posee las notas dulces y acidas de las manzanas verdes y rojas.','',16000,'Und',5,'NUEVO',(select id from grupos where nombre='VINAGRES NATURALES'),(select id from subgrupos where nombre='OTROS' and idsubgrupo=(select id from grupos where nombre='VINAGRES NATURALES')),(select id from marcas where nombre='VINAGRES GOLDEN '),5,15000,3,null,null,null,null,'7706160000012.png'),
('7706160000036','VINAGRE DE PERA X 500 ML ','El vinagre de los hombres, la pera es considerada fruto del hombre. Aderezo perfecto para ensaladas de verduras, crudités, aliños, escabeches y adobos. Aporta agradable aroma frutal a platos de carnes mixtas e incluso postres y encurtidos. Se puede consumir directamente diluyendo 3 cucharadas en un vaso con agua, después de las comidas, varias veces al día.','',16000,'Und',5,'NUEVO',(select id from grupos where nombre='VINAGRES NATURALES'),(select id from subgrupos where nombre='OTROS' and idsubgrupo=(select id from grupos where nombre='VINAGRES NATURALES')),(select id from marcas where nombre='VINAGRES GOLDEN '),5,15000,3,null,null,null,null,'7706160000036.png'),
('7706160000388','VINAGRE FINAS HIERBAS X 250 ML ','Vinagre de manzana natural, elaborado a partir de la doble fermentación del jugo de manzana con finas hierbas. Este vinagre aromatiza cualquier comida, dando un exquisito sabor. Especial para carnes, encurtidos, pastas, vinagretas, Queso Marinado. Con este vinagre podrás hacer una deliciosa reducción.','',25000,'Und',5,'NUEVO',(select id from grupos where nombre='VINAGRES NATURALES'),(select id from subgrupos where nombre='OTROS' and idsubgrupo=(select id from grupos where nombre='VINAGRES NATURALES')),(select id from marcas where nombre='VINAGRES GOLDEN '),1,24000,3,null,null,null,null,'7706160000388.png'),
('7706160000029','VINAGRE FRUTOS ROJOS X500 ML ','Vinagre natural elaborado a partir de la doble fermentación del jugo de uva Isabela, fresas y moras. Este vinagre aporta un sabor único en especial a los pescados y mariscos. También se utiliza en reducción para postres y pastelería. Otros usos en vinagretas, ensaladas y pepinillos. Se puede consumir directamente diluyendo 3 cucharadas en un vaso con agua, después de las comidas, varias veces al día.','',16000,'Und',5,'NUEVO',(select id from grupos where nombre='VINAGRES NATURALES'),(select id from subgrupos where nombre='OTROS' and idsubgrupo=(select id from grupos where nombre='VINAGRES NATURALES')),(select id from marcas where nombre='VINAGRES GOLDEN '),5,15000,3,null,null,null,null,'7706160000029.png'),
('VINAGRELULO','VINAGRE LULO X 250 ML','Vinagre utilizado en la coctelería, sus notas acidas y su exquisito aroma logra un perfecto equilibrio al mezclarlo con licores para obtener resultados fascinantes e interesantes. Se puede utilizar en ensaladas de frutas.','',25000,'Und',5,'NUEVO',(select id from grupos where nombre='VINAGRES NATURALES'),(select id from subgrupos where nombre='OTROS' and idsubgrupo=(select id from grupos where nombre='VINAGRES NATURALES')),(select id from marcas where nombre='VINAGRES GOLDEN '),5,24000,3,null,null,null,null,'VINAGRELULO.png'),
