('CREMOR04','CREMOR TARTARO X K            ','El cremor tártaro, cuyo nombre químico es bitrartato de potasio, básicamente es un polvo blanco, sin sabor específico','*Para hacer merengues y glaseado para postres, solo debes mezclarlo con las claras de huevo, 1/8 de cdita de cremor por cada clara.
*Se puede agregar a las masas de los panes y pasteles para darles mayor volumen y que queden más esponjosos. *Es uno de los ingredientes básicos del polvo para hornear, por lo que puedes usarlo para sustituirlo, justo con el bicarbonato de sodio.*Para elaborar dulces o cubiertas con jarabes, ya que previene la formación de cristales de azúcar. *Los merengues al horno quedan más secos, ligeros y con picos más firmes gracias al cremor. *Evita que se endurezcan rápidamente los glaseados de los pasteles. *Para darle firmeza a la crema de leche o nata cuando se deben batir para montar. *Reduce el sabor dulce de los endulcorantes. *Funciona como conservante natural para los alimentos.',42000,'Gr',,'NORMAL',(select id from grupos where nombre='QUIMICOS'),(select id from subgrupos where nombre='OTROS' and idsubgrupo=(select id from grupos where nombre='QUIMICOS')),(select id from marcas where nombre='SIN MARCA'),5,39000,4,null,null,null,null,'CREMOR04.png'),
